import React from "react";
import KanjiData from "./kanjidata.js";

const Kanji_Card = () => {
    const KData = KanjiData;
    console.log(KData);
    return (
        <>
            <div>
                {KanjiData.map((kanji, key) => {
                    return (
                        <div key={key}>
                            {kanji.id}
                            {kanji.words.map((data, key) => {
                                return (
                                    <div key={key}>
                                        <div>{data}</div>
                                    </div>
                                )
                            })}
                        </div>
                    )
                })}
            </div>
        </>
    ) 
}

export default Kanji_Card;
